/Pratik Backup/C Drive/workspace/kotak_chatbot2/kotak2/static/temp_session_files/1547/Clipboard/image-003.png\", \"type\": \"Image\"}, {\"Text\": \"\", \"Image\": \"F:/Pratik Backup/C Drive/workspace/kotak_chatbot2/kotak2/static/temp_session_files/1547/Clipboard/image-004.png\", \"type\": \"Image\"}, {\"Text\": \"\", \"Image\": \"F:/Pratik Backup/C Drive/workspace/kotak_chatbot2/kotak2/static/temp_session_files/1547/Clipboard/image-005.png\", \"type\": \"Image\"}], \"type\": \"Instruction\"}',' ',' ',' '),(2408,1548,'account closure ',' ',' ',' ',' ',' ','Info','{\"Text\": \"account closure\", \"id\": \"\"}','account closure','0','Process Tree Processes','{\"Process\": [], \"Text\": \"When a customer visit a branch with a letter/request for closure of account , to the extent possible the ,respective RM/RO should handle their customer. In the absence of the concerned RM, SM/BOM/BM to speak with the customer. \\nPlease select the appropriate case : \", \"col_no\": [3, 3], \"line_no\": [1620, 1620], \"type\": \"DTHyperlink\", \"DTHyperlink\": [\"Channels of closure request\", \"Retention Efforts\"]}',' ',' ',' '),(2409,1548,' ','account closure ',' ',' ',' ',' ','DTHyperlink','{\"col_no\": 3, \"line_no\": 1620, \"DTHyperlink\": \"Channels of closure request\"}',' ','0','Process Tree Options','{\"Process\": [], \"Text\": [], \"col_no\": [4, 4, 4], \"line_no\": [1621, 1621, 1621], \"type\": \"DTHyperlink\", \"DTHyperlink\": [\"Request through Customer in person\", \"Request through Customer Bearer/Representative \", \"Request through Mail/Courier/Drop Box \"]}',' ',' ',' '),(2410,1548,' ',' ','account closure ',' ',' ',' ','DTHyperlink','{\"col_no\": 4, \"line_no\": 1621, \"DTHyperlink\": \"Request through Customer in person\"}',' ','0','Process Tree Processes','{\"Process\": [\"When a customer visit a branch with a letter/request for closure of account , to the extent possible the ,respective RM/RO should handle their customer. In the absence of the concerned RM, SM/BOM/BM to speak with the customer. \", \"a) RM/SM/BOM to make all the checks related to account\", \"b) All the attempts should be made to retain the customer after checking elements. \"], \"Text\": [], \"type\": \"DTHyperlink\"}',' ',' ',' '),(2411,1548,' ',' ',' ','account closure ',' ',' ','DTHyperlink','{\"col_no\": 4, \"line_no\": 1621, \"DTHyperlink\": \"Request through Customer Bearer/Representative \"}',' ','0','Process Tree Processes','{\"Process\": [\"1. When a Bearer comes, with a customer letter for closure of the account, to the extent possible, RMs should handle their respective customer\\u2019s representative. In the absence of concerned RM for CAT A & B, Branch Manager (minimum SM) and for CAT C & D, Service Manager (minimum RO) to meet with the customer. \", \"2. RM/SM/BOM to generate SR in Siebel and self-assign. \", \"3. Requests from representatives of CAT A & B customers approaching the Branch or those requiring urgent attention (as expressed by the representative) to be accepted for immediate handling by the branch.\", \"4. While an attempt for retention is being made as detailed in chapter \\u201cRetention effort for Customers closing Resident Account\\u201d\", \"5. Each request on receipt to be updated on Siebel and self-assigned. Call Description on Siebel to state \\u201c<SOURCE OF REQUEST> (e.g. Letter / EMAIL / CIP) FOR ACCOUNT CLOSURE\\u201d. \", \"6. In case the account closure request is received in form of letter then branch needs to obtain required details as per the bank format. \", \"7. Branch Staff must scrutinize the letter. If letter does not contain all required details as per the closure checklist, Branch Staff must obtain the same \", \"8. If all details are not present, Branch Staff must hand over form to bearer and ask him to get completed form signed by the account holder. \", \"9. If there are major omissions like:\", \"a) cheque book/ debit card not brought by the bearer \", \"b) declaration of destroying the cheque book/ debit card not enclosed \", \"c) Signature of holders (In case of Joint Account All Holders to Sign the request),\", \"d) Branch Staff must call up the customer and ask him to fill up the account closure form at the branch.\", \"10. If there are minor omissions, the Branch Staff should call up the customer and obtain the necessary information. \", \"11. Signature verification must be done. In case of a signature mismatch, the request cannot be processed. Branch Staff must hand over the form to bearer and ask him to get the downloadable form signed by account holder. \", \"If letter contains all relevant details, it can be sent to  CPC/RPC as per the existing protocol. \"], \"Text\": [], \"type\": \"DTHyperlink\"}',' ',' ',' '),(2412,1548,' ',' ',' ',' ','account closure ',' ','DTHyperlink','{\"col_no\": 4, \"line_no\": 1621, \"DTHyperlink\": \"Request through Mail/Courier/Drop Box \"}',' ','0','Process Tree Processes','{\"Process\": [\"1. Closure requests received at the Branch drop box or through post / courier for all customers to  Actioned on the same day of the instruction received\", \"2. Closure requests received at the drop box or PO box for all customers to be despatched per the current process to Centralized Correspondence Unit (CCU) of Customer Contact Centre (CCC) in Mumbai who in turn will hand it over to respective Home branch \", \"3. CCU will log a  Siebel and assign to Home Branch. The request letter or closure form will be sent to the branch on Day 0. \", \"4. The original letter sent  by Courier to reach the Branch within 48 hours with the Siebel ID number mentioned in the customer request. \", \"5. On receipt of closure request the branch staff to acknowledged the SR and routed to the concerned RM for appropriate action. \", \"6. Concerned RM to call customer, if RM is not present SM/BOM to call customer and understand the reason for closure and try to retain the customer as per the existing protocol. \"], \"Text\": [], \"type\": \"DTHyperlink\"}',' ',' ',' '),(2413,1548,' ',' ',' ',' ',' ','account closure ','DTHyperlink','{\"col_no\": 3, \"line_no\": 1620, \"DTHyperlink\": \"Retention Efforts\"}',' ','0','Process Tree Options','{\"Process\": [\"Check for reasons and suggest alternatives\", \"\\n\"], \"Text\": [], \"col_no\": [4, 4, 4, 4, 4, 4], \"line_no\": [1649, 1649, 1649, 1649, 1649, 1649], \"type\": \"DTHyperlink\", \"DTHyperlink\": [\"Check for reasons and suggest alternatives\", \"Shifting\", \"Accessibility\", \"Charges\", \"High AMB/AQB\", \"None of the above\"]}',' ',' ',' '),(2414,1548,' ',' ',' ',' ',' ',' ','DTHyperlink','{\"col_no\": 4, \"line_no\": 1649, \"DTHyperlink\": \"Shifting\"}',' ','0',' ','{\"Process\": [], \"Text\": [], \"type\": \"DTHyperlink\"}',' ',' ',' '),(2415,1549,'account closure ',' ',' ',' ',' ',' ','Info','{\"Text\": \"account closure\", \"id\": \"\"}','account closure','0','Process Tree Processes','{\"Process\": [], \"Text\": \"When a customer visit a branch with a letter/request for closure of account , to the extent possible the ,respective RM/RO should handle their customer. In the absence of the concerned RM, SM/BOM/BM to speak with the customer. \\nPlease select the appropriate case : \", \"col_no\": [3, 3], \"line_no\": [1620, 1620], \"type\": \"DTHyperlink\", \"DTHyperlink\": [\"Channels of closure request\", \"Retention Efforts\"]}',' ',' ',' '),(2416,1549,' ','account closure ',' ',' ',' ',' ','DTHyperlink','{\"col_no\": 3, \"line_no\": 1620, \"DTHyperlink\": \"Retention Efforts\"}',' ','0','Process Tree Options','{\"Process\": [\"Check for reasons and suggest alternatives\", \"\\nCheck for reasons and suggest alternatives\"], \"Text\": [], \"col_no\": [4, 4, 4, 4, 4], \"line_no\": [1649, 1649, 1649, 1649, 1649], \"type\": \"DTHyperlink\", \"DTHyperlink\": [\"Shifting\", \"Accessibility\", \"Charges\", \"High AMB/AQB\", \"None of the above\"]}',' ',' ',' '),(2417,1550,'account closure ',' ',' ',' ',' ',' ','Info','{\"Text\": \"account closure\", \"id\": \"\"}','