xtreme cases and revert to the customer. This TAT for revert to be communicated to the customer upfront.\", \"3) Customers to be sent a personalised letter thanking them for their time and an acknowledgement, that we value their business and have remedied whatever caused them to want to leave in the first place. A list of all reasons for closure with the action taken, to be stated. \", \"4) Once the customer has been retained, the customer letter / form duly marked \\u201cNOT FOR CLOSURE \\u2013 RETAINED\\u201d, along with a copy of the resolution letter to be sent to CPC for filing in the customer record.\", \"5) Siebel to be updated with the same comment and closed.\", \"In case the BOM/SM/BM/ RBM / AM or the branch staff are able / Not able  to retain the customer, then protthe SR which has been created needs to be closed with the Closure Description in Siebel as, \\u201cCustomer Retained\\u201d. This needs to be done diligently and would be subject to audits.\"], \"Text\": [], \"type\": \"DTHyperlink\"}',' ',' ',' '),(2421,1550,' ',' ',' ',' ','account closure ',' ','DTHyperlink','{\"col_no\": 5, \"line_no\": 1650, \"DTHyperlink\": \"Customer is unwilling to give us another chance \"}',' ','0','Process Tree Processes','{\"Process\": [\"Customer will pay the  necessary amount to regularize the account \", \"Customer is unwilling to regularize the account after all attempts then branch user to follow the protocol as detailed in chapter \\u201cAccount closure requests with debit balance/TBMS lien.\\u201d \", \"1) Where the customer is not willing to continue, Branch to ensure that the complete details on Account closure form and all the checks to be made as detailed in the chapter  \\u201cGeneral Guidelines to be followed for Account closure\\u201d \", \"2) In case of any incomplete request, the customer needs to be apprised of the requirements and Siebel to be updated accordingly. \", \"3) If the a/c closure request is complete in all respects / once the complete 