 \", \"2. RM/SM/BOM to generate SR in Siebel and self-assign. \", \"3. Requests from representatives of CAT A & B customers approaching the Branch or those requiring urgent attention (as expressed by the representative) to be accepted for immediate handling by the branch.\", \"4. While an attempt for retention is being made as detailed in chapter \\u201cRetention effort for Customers closing Resident Account\\u201d\", \"5. Each request on receipt to be updated on Siebel and self-assigned. Call Description on Siebel to state \\u201c<SOURCE OF REQUEST> (e.g. Letter / EMAIL / CIP) FOR ACCOUNT CLOSURE\\u201d. \", \"6. In case the account closure request is received in form of letter then branch needs to obtain required details as per the bank format. \", \"7. Branch Staff must scrutinize the letter. If letter does not contain all required details as per the closure checklist, Branch Staff must obtain the same \", \"8. If all details are not present, Branch Staff must hand over form to bearer and ask him to get completed form signed by the account holder. \", \"9. If there are major omissions like:\", \"a) cheque book/ debit card not brought by the bearer \", \"b) declaration of destroying the cheque book/ debit card not enclosed \", \"c) Signature of holders (In case of Joint Account All Holders to Sign the request),\", \"d) Branch Staff must call up the customer and ask him to fill up the account closure form at the branch.\", \"10. If there are minor omissions, the Branch Staff should call up the customer and obtain the necessary information. \", \"11. Signature verification must be done. In case of a signature mismatch, the request cannot be processed. Branch Staff must hand over the form to bearer and ask him to get the downloadable form signed by account holder. \", \"If letter contains all relevant details, it can be sent to  CPC/RPC as per the existing protocol. \"], \"Text\": [], \"type\": \"DTHyperlink\"}',' ',' ',' '),(2468,1559,' ',' ',' ','account closure ',