able / Not able  to retain the customer, then protthe SR which has been created needs to be closed with the Closure Description in Siebel as, \\u201cCustomer Retained\\u201d. This needs to be done diligently and would be subject to audits.\"], \"Text\": [], \"type\": \"DTHyperlink\"}',' ',' ',' '),(2471,1559,' ',' ',' ',' ',' ',' ','DTHyperlink','{\"col_no\": 4, \"line_no\": 1648, \"DTHyperlink\": \"Charges\"}',' ','0','Process Tree Options','{\"Process\": [\"1) Customer expresses concerns on high charges, ascertain the nature of charges levied and recommend an upgraded account where required (e.g. if customer finds DD charges high, up-sell to an account with a higher free DD limit or an account offering At Par cheque facility if usage is on our locations). Communicate the AMB/AQB and NMC to customer clearly.\", \"2) The account can be upgraded/downgrade as per customer requirement by retaining the same account Number\", \"3) Branch can also explain the benefits of Basic/Small Account and offer conversion to the said  account as it will address their inability to maintain the account.\", \"\\n\"], \"Text\": [], \"col_no\": [5, 5], \"line_no\": [1683, 1683], \"type\": \"DTHyperlink\", \"DTHyperlink\": [\"Customer is willing to give us another chance\", \"Customer is unwilling to give us another chance \"]}',' ',' ',' '),(2472,1560,'account closure ',' ',' ',' ',' ',' ','Info','{\"Text\": \"account closure\", \"id\": \"\"}','account closure','0','Process Tree Processes','{\"Process\": [], \"Text\": \"When a customer visit a branch with a letter/request for closure of account , to the extent possible the ,respective RM/RO should handle their customer. In the absence of the concerned RM, SM/BOM/BM to speak with the customer. \\nPlease select the appropriate case : \", \"col_no\": [3, 3], \"line_no\": [1620, 1620], \"type\": \"DTHyperlink\", \"DTHyperlink\": [\"Channels of closure request\", \"Retention Efforts\"]}',' ',' ',' '),(2473,1560,' ','account closure ',' ',' ',