it card not brought by the bearer \", \"b) declaration of destroying the cheque book/ debit card not enclosed \", \"c) Signature of holders (In case of Joint Account All Holders to Sign the request),\", \"d) Branch Staff must call up the customer and ask him to fill up the account closure form at the branch.\", \"10. If there are minor omissions, the Branch Staff should call up the customer and obtain the necessary information. \", \"11. Signature verification must be done. In case of a signature mismatch, the request cannot be processed. Branch Staff must hand over the form to bearer and ask him to get the downloadable form signed by account holder. \", \"If letter contains all relevant details, it can be sent to  CPC/RPC as per the existing protocol. \", \"\\nSelect the customer type\"], \"Text\": [], \"col_no\": [5, 5], \"line_no\": [1756, 1756], \"type\": \"DTHyperlink\", \"DTHyperlink\": [\"Individual\", \"Non-Individual\"]}',' ',' ',' '),(2525,1571,' ',' ',' ','account closure ',' ',' ','DTHyperlink','{\"col_no\": 4, \"line_no\": 1621, \"DTHyperlink\": \"Request through Customer in person\"}',' ','0','Process Tree Options','{\"Process\": [\"When a customer visit a branch with a letter/request for closure of account , to the extent possible the ,respective RM/RO should handle their customer. In the absence of the concerned RM, SM/BOM/BM to speak with the customer. \", \"a) RM/SM/BOM to make all the checks related to account\", \"b) All the attempts should be made to retain the customer after checking elements. \", \"\\nSelect the customer type\"], \"Text\": [], \"col_no\": [5, 5], \"line_no\": [1625, 1625], \"type\": \"DTHyperlink\", \"DTHyperlink\": [\"Individual\", \"Non-Individual\"]}',' ',' ',' '),(2526,1571,' ',' ',' ',' ','account closure ',' ','DTHyperlink','{\"col_no\": 5, \"line_no\": 1625, \"DTHyperlink\": \"Individual\"}',' ','0','Process Tree Options','{\"Process\": [\"Check for reasons and suggest alternatives\"], \"Text\": [], \"col_no\": [6, 6, 6, 6, 6], \"line_no\": [1626, 1626, 1626, 1626, 1626], \"type\": \"DTHyperlink\", \"DTHyperlink\": [\"Shifting\", \"Accessibility\", \"Charges\", \"High AMB/AQB\", \"None of the above\"]}',' ',' ',' '),(2527,1571,' ',' ',' ',' ',' ','account closure ','DTHyperlink','{\"col_no\": 6, \"line_no\": 1626, \"DTHyperlink\": \"Shifting\"}',' ','0','Process Tree Options','{\"Process\": [\"If customer is shifting to a location where we have a branch, a new account need not be opened at the location. Customer to be informed that the same account can be transacted upon.\", \"\\n\"], \"Text\": [], \"col_no\": [7, 7], \"line_no\": [1628, 1628], \"type\": \"DTHyperlink\", \"DTHyperlink\": [\"Customer is willing to give us another chance\", \"Customer is unwilling to give us another chance \"]}',' ',' ',' '),(2528,1571,' ',' ',' ',' ',' ',' ','DTHyperlink','{\"col_no\": 7, \"line_no\": 1628, \"DTHyperlink\": \"Customer is willing to give us another chance\"}',' ','0','Process Tree Processes','{\"Process\": [\"1) In case of Issues expressed by the customer where he / she is willing to give the Bank another chance. \", \"2) Branch to attempt fix the problem within 48 hours or 7 days on the outside for extreme cases and revert to the customer. This TAT for revert to be communicated to the customer upfront.\", \"3) Customers to be sent a personalised letter thanking them for their time and an acknowledgement, that we value their business and have remedied whatever caused them to want to leave in the first place. A list of all reasons for closure with the action taken, to be stated. \", \"4) Once the customer has been retained, the customer letter / form duly marked \\u201cNOT FOR CLOSURE \\u2013 RETAINED\\u201d, along with a copy of the resolution letter to be sent to CPC for filing in the customer record.\", \"5) Siebel to be updated with the same comment and closed.\", \"In case the BOM/SM/BM/ RBM / AM or the branch staff are able / Not able  to retain the customer, then protthe SR which has been created needs to be closed with the Closure Description in Siebel as, \\u201cCustomer Retained\\u201d. This needs to be done diligently and would be subject to audits.\"], \"Text\": [], \"type\": \"DTHyperlink\"}',' ',' ',' '),(2529,1571,' ',' ',' ',' ',' ',' ','DTHyperlink','{\"col_no\": 7, \"line_no\": 1628, \"DTHyperlink\": \"Customer is unwilling to give us another chance \"}',' ','0','Process Tree Processes','{\"Process\": [\"Customer will pay the  necessary amount to regularize the account \", \"Customer is unwilling to regularize the account after all attempts then branch user to follow the protocol as detailed in chapter \\u201cAccount closure requests with debit balance/TBMS lien.\\u201d \", \"1) Where the customer is not willing to continue, Branch to ensure that the complete details on Account closure form and all the checks to be made as detailed in the chapter  \\u201cGeneral Guidelines to be followed for Account closure\\u201d \", \"2) In case of any incomplete request, the customer needs to be apprised of the requirements and Siebel to be updated accordingly. \", \"3) If the a/c closure request is complete in all respects / once the complete request is received from the customer, the same needs to be sent to CPC, post updating the Siebel \", \"4) Branch to journal of the attempts made to retain the customer.\", \"In case the BOM/SM/BM/ RBM / AM or the branch staff are able / Not able  to retain the customer, then protthe SR which has been created needs to be closed with the Closure Description in Siebel as, \\u201cCustomer Retained\\u201d. This needs to be done diligently and would be subject to audits.\"], \"Text\": [], \"type\": \"DTHyperlink\"}',' ',' ',' '),(2530,1571,' ',' ',' ',' ',' ',' ','DTHyperlink','{\"col_no\": 6, \"line_no\": 1626, \"DTHyperlink\": \"Accessibility\"}',' ','0','Process Tree Options','{\"Process\": [\"If customer is closing his/ her account due to inconvenient accessibility, solutions like Home Banking, Beat Pi