620], \"topic\": \"\", \"type\": \"DTHyperlink\", \"DTHyperlink\": [\"Channels of closure request\", \"Retention Efforts\"]}',' ',' ',' '),(2899,1760,' ','account closure ',' ',' ',' ',' ','DTHyperlink','{\"col_no\": 4, \"line_no\": 1620, \"DTHyperlink\": \"Channels of closure request\"}',' ','0','Process Tree Options','{\"current_sub_topic\": \"Channels of closure request\", \"sub_topic_list\": [\"Channels of closure request\", \"Select the customer type\", \"Check for reasons and suggest alternatives\", \"Check whether customer willing to give another chance\", \"Suggest options if customer willing to give another chance\", \"Process if customer unwilling to give another chance\", \"Account Closure Process\"], \"Process\": [], \"Text\": [], \"col_no\": [5, 5, 5], \"line_no\": [1621, 1621, 1621], \"topic\": \"\", \"type\": \"DTHyperlink\", \"DTHyperlink\": [\"Request through Customer in person\", \"Request through Customer Bearer/Representative \", \"Request through Mail/Courier/Drop Box \"]}',' ',' ',' '),(2900,1760,' ',' ','account closure ',' ',' ',' ','DTHyperlink','{\"col_no\": 5, \"line_no\": 1621, \"DTHyperlink\": \"Request through Customer Bearer/Representative \"}',' ','0','Process Tree Options','{\"current_sub_topic\": \"Select the customer type\", \"sub_topic_list\": [\"Channels of closure request\", \"Select the customer type\", \"Check for reasons and suggest alternatives\", \"Check whether customer willing to give another chance\", \"Suggest options if customer willing to give another chance\", \"Process if customer unwilling to give another chance\", \"Account Closure Process\"], \"Process\": [\"1. When a Bearer comes, with a customer letter for closure of the account, to the extent possible, RMs should handle their respective customer\\u2019s representative. In the absence of concerned RM for CAT A & B, Branch Manager (minimum SM) and for CAT C & D, Service Manager (minimum RO) to meet with the customer. \", \"2. RM/SM/BOM to generate SR in Siebel and self-assign. \", \"3. Requests from representatives of CAT A & B customers approaching the Branch or those requiring urgent attention (as expressed by the representative) to be accepted for immediate handling by the branch.\", \"4. While an attempt for retention is being made as detailed in chapter \\u201cRetention effort for Customers closing Resident Account\\u201d\", \"5. Each request on receipt to be updated on Siebel and self-assigned. Call Description on Siebel to state \\u201c<SOURCE OF REQUEST> (e.g. Letter / EMAIL / CIP) FOR ACCOUNT CLOSURE\\u201d. \", \"6. In case the account closure request is received in form of letter then branch needs to obtain required details as per the bank format. \", \"7. Branch Staff must scrutinize the letter. If letter does not contain all required details as per the closure checklist, Branch Staff must obtain the same \", \"8. If all details are not present, Branch Staff must hand over form to bearer and ask him to get completed form signed by the account holder. \", \"9. If there are major omissions like:\", \"a) cheque book/ debit card not brought by the bearer \", \"b) declaration of destroying the cheque book/ debit card not enclosed \", \"c) Signature of holders (In case of Joint Account All Holders to Sign the request),\", \"d) Branch Staff must call up the customer and ask him to fill up the account closure form at the branch.\", \"10. If there are minor omissions, the Branch Staff should call up the customer and obtain the necessary information. \", \"11. Signature verification must be done. In case of a signature mismatch, the request cannot be processed. Branch Staff must hand over the form to bearer and ask him to get the downloadable form signed by account holder. \", \"If letter contains all relevant details, it can be sent to  CPC/RPC as per the existing protocol. \", \"\\n\"], \"Text\": [], \"col_no\": [6, 6], \"line_no\": [1763, 1763], \"topic\": \"\", \"type\": \"DTHyperlink\", \"DTHyperlink\": [\"Individua